import styled from 'styled-components';

function Homepage() {
  return (
    <StyledWrapper>
      <div id="a">
        <div className="inside">x</div>
        <div className="inside" id='middle'>y</div>
        <div className="inside">z</div>
      </div>
      <div id="b">b</div>
      <div id="c">c</div>
      <div id="d">d</div>
      <div id="e">e</div>
      <div id="f">f</div>
      <div id="g">g</div>
      <div id="h">h</div>
    </StyledWrapper>
  );
}

const StyledWrapper = styled.div`
  height: 100vh;
  display: grid;
  grid-template-columns: repeat(6, 1fr);
  grid-template-rows: repeat(5, 150px);
  grid-gap: 20px 20px;
  padding-top: 20px;

  background: var(--mainbg);
  background-size: var(--mainbg-size);

  div {
    background-color: #1d1d1d;
    color: #fe4a49;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 40px;
  }

  #a,
  #b {
    grid-column-start: 1;
    grid-column-end: 7;
  }

  #a {
    display: flex;
    justify-content: space-between;
    padding: 0 20px;
  }

  .inside {
    border: solid #fe4a49;
    padding: 20px 20px;
    flex: 0 0 auto;
  }
  #middle{
    flex:grow;
  }
`;

export default Homepage;
